import axios from "axios";
import { useState,useEffect }  from "react";
import { useNavigate, useParams} from "react-router-dom";
const URI = "http://localhost:8080/cuenta/"

let headers = {
    "usuario" : sessionStorage.getItem("usuario"),
    "clave"   : sessionStorage.getItem("clave")
  };
const Deposito = () => {
    const [id_cuenta, setId_cuenta] = useState("");
    const [fecha_apertura, setFecha_apertura] = useState("");
    const [saldo_cuenta, setSaldo_cuenta] = useState("");
    const navigate = useNavigate();

    const {id} = useParams()

    const editar = async (e) => {
        e.preventDefault();
    
        const UpdateCuenta= await axios({
            method: "PUT",
            url: URI,
            data: {
                id_cuenta: id_cuenta, fecha_apertura: fecha_apertura, saldo_cuenta: saldo_cuenta
            },
            headers: headers 
          });
         
        navigate("/cliente");
      };

      useEffect( ()=>{
        getCuentaById()
    },[])

    const getCuentaById = async () => {

        const res =  await axios({
            method: "GET",
            url: URI+"list/"+id,
            headers: headers 
          });
        setId_cuenta(res.data.id_cliente)
        setFecha_apertura(res.data.fecha_apertura)
        setSaldo_cuenta(res.data.saldo_cuenta)
    }

    return(
        <div>
        <h3>Edit PUT</h3>
        <form onSubmit={editar}>
            <div className="mb-3">
            <label className="form-label">ID</label>
            <input
                value={id_cliente}
                onChange={(e) => setId_cliente(e.target.value)}
                type="text"
                disabled="false"
                className="form-control"
            />
            </div>
            <div className="mb-3">
            <label className="form-label">Nombre</label>
            <input
                value={nombre_cliente}
                onChange={(e) => setNombre_cliente(e.target.value)}
                type="text"
                className="form-control"
            />
            </div>
            <div className="mb-3">
            <label className="form-label">Clave</label>
            <input
                value={clave_cliente}
                onChange={(e) => setClave_cliente(e.target.value)}
                type="password"
                className="form-control"
            />
            </div>
            <button type="submit" className="btn btn-primary">
            Guardar
            </button>
        </form>
    </div>
    );
};

export default Deposito;
